import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, question, questionId, id,props }){

    const q = getQuestionId(() => id);
    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>  
                <p>111</p>
                <p>{q.title}</p>       
        </Paper>
    )
}

export default Question;
